import Grid from '@material-ui/core/Grid'
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
        width: '30vh',
        height: '20vh'
    },
    background: {
        height: '80vh',
        overflow: 'hidden',
        zIndex: 1,
        width: '100vh',
        backgroundImage: `url(${"/static/img/frontpage1.jpg"})`
    },
}));

const Index = () => {
    const classes = useStyles();
    return (
        <div>
            <Grid container spacing={3}>
                <Grid item xs={12} className={classes.background}>
                    <Paper className={classes.paper}>Sign Up for our Newsletter!</Paper>
                </Grid>
                <Grid item xs={6}>
                    <Paper>xs=6</Paper>
                </Grid>
                <Grid item xs={6}>
                    <Paper >xs=6</Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper >xs=3</Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper >xs=3</Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper >xs=3</Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper >xs=3</Paper>
                </Grid>
            </Grid>
        </div>
    );
};

export default Index;
